import React from 'react';
import './App.css';


function Car(props){
  return <h2>I am a {props.brand}!</h2>;
}

function App() {
  return (
    <>
    <div className="App">
      <h1>Hello buddy!</h1>
    </div>
    <div><p>hello there</p></div>
    <Car brand='Ford'/>
    </>
  );
}

export default App;
